import React from 'react';

function MyBookingSidebar({ cartItems, onCheckout, onViewCart }) {
  return (
    <div className="my-booking-sidebar">
      <h3>My Booking</h3>
      {cartItems.map((item) => (
        <div key={item.id}>
          <p>{item.name} x {item.quantity}</p>
          <p>{item.price}</p>
        </div>
      ))}
      <button onClick={onViewCart}>View Cart</button>
      <button onClick={onCheckout}>Checkout</button>
    </div>
  );
}

export default MyBookingSidebar;
